import React, { useEffect } from 'react';
import { fetchMenu } from '../../store'

const Menu = () => {
  const dispatch = useDispatch();
  const menuItems = useSelector(state => state.menu);

  useEffect(() => {
    dispatch(fetchMenu());
  }, []);

  console.log('menu: ', menuItems);

  return (
    <div>
      <h1>Hello, this is the Menu Page.</h1>
    </div>
  );
};

export default Menu;
